import React, { Component } from 'react'

export default class Table extends Component {
    renderTableData(){
        return this.props.data.map((val, index)=>{
            const{Class, Date, Instructor, Subject} = val;
            return(
            <tr key = {index}>
                <td>{Class}</td>
                <td>{Date}</td>
                <td>{Instructor}</td>
                <td>{Subject}</td>
            </tr>
            )
        })
    }
    render() {
        //let tableCols = Object.getOwnPropertyNames(this.props.data[0]);
        return(
            <div>
                <table className="Table">
                    <tbody>
                {
                    renderTableData()
                }
                </tbody>
            </table>
            </div>
        );
    }
}
